The amount of time we spend sitting down in front of our screens has increased substantially over the past decade and we are no longer as active as we used to be. For this reason, many of us have developed an anterior pelvic tilt of the pelvis which can make us look like we have a belly when we donâ€™t, and even worse it is a common source of lower back pain.â €
â €
While there are several known causes of an anterior tilt of the pelvis â€“ such as injury to or overuse of the hamstrings, glutes, hip flexors, and hip extensors â€“ the most likely culprit is a sedentary lifestyle and too much sitting. Sitting for prolonged periods of time without proper lumbar support causes the hip flexors to tighten and shorten, thereby drawing the pelvis forward.â €
â €
Hereâ€™s a summary of the muscular imbalances of an anterior pelvic tilt:â €
â€¢	Tight hip flexorsâ €
â€¢	Tight quads/thighsâ €
â€¢	Tight lower backâ €
â€¢	Weak glutesâ €
â€¢	Weak hamstringsâ €
â€¢	Weak coreâ €
â €
It is important to note that some degree of anterior pelvic tilt is normal; in fact, research indicates that as many as 75 to 85 per cent of adults exhibit an anterior pelvic tilt with no noticeable symptoms.â €
â €
What Are The Symptoms of anterior pelvic tilt?â €
Aside from the muscular imbalances described above, there can be other symptoms associated with an anterior pelvic tilt.â €
Most people with mild to moderate pelvic anterior tilt will not notice any pain, discomfort, or decreased range of motion.â €
â €
If left untreated, however, severe cases of anterior pelvic tilt can increase the amount of pressure placed on the vertebrae of the lower spine, leading to symptoms such as:â €
â€¢	Low back pain â €
â€¢	Groin pain â €
â€¢	Muscle stiffnessâ €
â€¢	Postural changes â €
â €
The good news is an anterior pelvic tilt can be fixed through corrective exercises and stretches. You need to reverse all the muscle imbalances it has caused. Hereâ€™s a quick summary of what to do:â €
â€¢	Release and stretch the tight hip flexorsâ €
â€¢	Release and stretch the quads/thighsâ €
â€¢	Stretch the lower backâ €
â€¢	Strengthen the glutesâ €
â€¢	Strengthen the hamstringsâ €
â€¢	Strengthen the coreâ €
â €
